import React from "react";

const About = () => {
  return (
    <div style={{ display: "flex", justifyContent: "center" }} >
      <img src="hi.jpg" style={{ width: "40%" }} />
      <p style={{ textAlign: "center", padding: "2rem", display: "flex", alignItems: "center" }}>串接 Pexels API 製作相片圖庫，僅作練習之用</p>
    </div>
  );
};

export default About;
